selector_to_html = {"a[href=\"#details-of-each-level-annotation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Details of Each Level Annotation<a class=\"headerlink\" href=\"#details-of-each-level-annotation\" title=\"Permalink to this heading\">#</a></h2><p>In this section, we explain the details of each level annotation.</p><p>Annotate tooth atlas is a difficult task, bacause of following reasons:</p>", "a[href=\"Level3_anno_epi.html#outer-enamel-epithelium\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Outer enamel epithelium<a class=\"headerlink\" href=\"#outer-enamel-epithelium\" title=\"Permalink to this heading\">#</a></h2><p>This cluster is annotated base on the study described in <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id8\" title=\"Jan Krivanek, Ruslan A. Soldatov, Maria Eleni Kastriti, Tatiana Chontorotzea, Anna Nele Herdina, Julian Petersen, Bara Szarowska, Marie Landova, Veronika Kovar Matejova, Lydie Izakovicova Holla, Ulrike Kuchler, Ivana Vidovic Zdrilic, Anushree Vijaykumar, Anamaria Balic, Pauline Marangoni, Ophir D. Klein, Vitor C. M. Neves, Val Yianni, Paul T. Sharpe, Tibor Harkany, Brian D. Metscher, Marc Baj\u00e9noff, Mina Mina, Kaj Fried, Peter V. Kharchenko, and Igor Adameyko. Dental cell type atlas reveals stem and differentiated cell types in mouse and human teeth. Nature Communications, 11(1):4816, September 2020. doi:10.1038/s41467-020-18512-7.\">Krivanek <em>et al.</em>, 2020</a>]</span>.\n<img alt=\"png\" src=\"../_images/C22-7.png\"/></p>", "a[href=\"Level3_anno_epi.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 3 Annotation<a class=\"headerlink\" href=\"#level-3-annotation\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"png\" src=\"img/anno-level3_epi.png\"/></p>", "a[href=\"#annotation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Annotation<a class=\"headerlink\" href=\"#annotation\" title=\"Permalink to this heading\">#</a></h1><p>In this section, we will adapt the annotation pipeline from <a class=\"reference external\" href=\"https://github.com/lsteuernagel/scHarmonization/\">scHarmonization</a> <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id22\" title=\"Lukas Steuernagel, Brian Y. H. Lam, Paul Klemm, Georgina K. C. Dowsett, Corinna A. Bauder, John A. Tadross, Tamara Sotelo Hitschfeld, Almudena del Rio Martin, Weiyi Chen, Alain J. de Solis, Henning Fenselau, Peter Davidsen, Irene Cimino, Sara N. Kohnke, Debra Rimmington, Anthony P. Coll, Andreas Beyer, Giles S. H. Yeo, and Jens C. Br\u00fcning. HypoMap\u2014a unified single-cell gene expression atlas of the murine hypothalamus. Nature Metabolism, 4(10):1402\u20131419, October 2022. doi:10.1038/s42255-022-00657-y.\">Steuernagel <em>et al.</em>, 2022</a>]</span> to our data.\nYou can just run this pipeline directly. Here, I just break down the pipeline into several steps for better understanding.</p>", "a[href=\"Level3_anno_epi.html#inner-enamel-epithelium\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Inner enamel epithelium<a class=\"headerlink\" href=\"#inner-enamel-epithelium\" title=\"Permalink to this heading\">#</a></h2><p>Based on the marker <em>Sfrp5</em>, <em>Cldn10</em> <span id=\"id2\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>, we annotate this cluster as inner enamel epithelium.\n<img alt=\"png\" src=\"../_images/C22-4.png\"/></p>", "a[href=\"Level3_anno_epi.html#stratum-intermedium\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Stratum intermedium<a class=\"headerlink\" href=\"#stratum-intermedium\" title=\"Permalink to this heading\">#</a></h2><p>Stratum intermedium markers (<em>Thbd</em>, <em>Jph4</em>) <span id=\"id3\">[<a class=\"reference internal\" href=\"../references.html#id8\" title=\"Jan Krivanek, Ruslan A. Soldatov, Maria Eleni Kastriti, Tatiana Chontorotzea, Anna Nele Herdina, Julian Petersen, Bara Szarowska, Marie Landova, Veronika Kovar Matejova, Lydie Izakovicova Holla, Ulrike Kuchler, Ivana Vidovic Zdrilic, Anushree Vijaykumar, Anamaria Balic, Pauline Marangoni, Ophir D. Klein, Vitor C. M. Neves, Val Yianni, Paul T. Sharpe, Tibor Harkany, Brian D. Metscher, Marc Baj\u00e9noff, Mina Mina, Kaj Fried, Peter V. Kharchenko, and Igor Adameyko. Dental cell type atlas reveals stem and differentiated cell types in mouse and human teeth. Nature Communications, 11(1):4816, September 2020. doi:10.1038/s41467-020-18512-7.\">Krivanek <em>et al.</em>, 2020</a>]</span> are expressed in this cluster.\n<img alt=\"png\" src=\"../_images/C22-5.png\"/></p>", "a[href=\"Level3_anno_epi.html#early-ameloblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Early ameloblast<a class=\"headerlink\" href=\"#early-ameloblast\" title=\"Permalink to this heading\">#</a></h2><p>We found a cluster specificly expressed mineralization marker <em>Dspp</em>, align with the study <span id=\"id4\">[<a class=\"reference internal\" href=\"../references.html#id38\" title=\"Yuta Chiba, Kan Saito, Daniel Martin, Erich T. Boger, Craig Rhodes, Keigo Yoshizaki, Takashi Nakamura, Aya Yamada, Robert J. Morell, Yoshihiko Yamada, and Satoshi Fukumoto. Single-Cell RNA-Sequencing From Mouse Incisor Reveals Dental Epithelial Cell-Type Specific Genes. Frontiers in Cell and Developmental Biology, September 2020. doi:10.3389/fcell.2020.00841.\">Chiba <em>et al.</em>, 2020</a>]</span>. Base on it\u2019s relationship with pre-ameloblast and secretory ameloblast, we annotate it as early ameloblast.\n<img alt=\"png\" src=\"../_images/C22-12.png\"/></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`div.content ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
